postcontent:
I'm looking to sell my FNX45 tactical that has been modified. The grip has been cut to a compact length and one magazine has been matched so it's 10+1 capacity. I bought the gun new back in December and have loved it it's had a little over 600 round through it all factory brass ammo with no malfunctions. Does have 2 full size magazines and factory soft case with all the original equipment the RMR does not come with it. Polished feed ramp. I know there isn't much interest for this but I'm wanting to go 357sig.   In size the grip is borderline shorted than my G19.  I'll ask 700 OBO and will come with all 3 magazines loaded with speed gold dots. Again the RMR IS NOT PART OF THE SALE this is my carry pistol at the moment so the RMR will remain on it until I have a buyer. 


EXPLANATION;
I was practicing dry firing at my home and needed to use the restroom so I went and came back to find my roommates dog chewing on my pistol the bottom of the grip was deformed and gouged so badly I couldn't insert a magazine so I decided to do whatever I needed to still be able to use the weapon so I cut the grip high enough to clear the gouges I then stippled the full grip and undercut the trigger guard all to cover the scratches and gouges it was a momentary lapse in judgment on my part but I did what I thought was the best at the time. I also modified one magazine to work compact it will hold 10+1 however it's a bear to get the magazine in with 10 rounds so I usually just keep 9 in it. I've had the pistol like this for about 3 months now and the only problem I've had is the small magazine doesn't like to always drop free without being helped.
